import React, {Component} from 'react';

class HomeList extends Component {
	render() {
		return (
			<ContentListWrapper>
				<li>
					<h3><a href='/'></a></h3>
				</li>
			</ContentListWrapper>
		)
	}
}

export default HomeList;
